import React, {Component} from 'react';

class Clothing extends Component {
  constructor(props) {
        super(props);
        this.state = {
            added: this.props.item.added == "no" ? false : true,
        };
    }
  addedToCart() {
      this.props.addToCart(this.props.item, this.state.added)
      this.setState({added: !this.state.added});
  }
  render() {
    return (
      <div className="clothing-box">
        <img id="added" src = { this.props.item.added === "yes"? "images/cart_full.jpg" : "images/cart_empty.jpeg"} alt = "" align="right" onClick = {this.addedToCart.bind(this)}></img>
        <p><img src={"images/" + this.props.item.id + ".jpg"} alt={this.props.item.name}></img></p>
        <h3>{this.props.item.ocassion} {this.props.item.name}</h3>
        <h3 id="price">${this.props.item.price}</h3>
      </div>
    );
  }
}

export default Clothing;
